import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ListadeTareas from './ListadeTareas';
import CrearTareas from './CrearTareas';

const App = () => {
  return (
    <Router>
      <div>
        <h1>Aplicaci√≥n de Tareas</h1>
        <nav>
          <ul>
            <li>
              <Link to="/">Lista de Tareas</Link>
            </li>
            <li>
              <Link to="/crear-tarea">Crear Nueva Tarea</Link>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<ListadeTareas />} />
          <Route path="/crear-tarea" element={<CrearTareas />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
